Wildest Islands: Series 1
Islands can be home to the most extreme examples of life and the some of the most dramatic landscapes. Natural selection fuels evolution in the most extraordinary way. Isolated for hundreds of thousands of years, pockets of individuals survive, thrive and adapt to fill all available niches fuelling a rapid development of new species. Wildest Islands, is a stunning five-part series featuring the world's most spectacular island locations. Dive into the crystal clear waters of the Caribbean; journey through the lush forests of Zanzibar; discover the unspoilt environs of the Hebrides; and uncover the enduring wonders of the Galapagos Islands as Wildest Islands investigates the rich history of these pristine paradises.


1)  Zanzibar: Land of Giants 
Lying 40km off the east coast of Tanzania in Africa, the Zanzibar Archipelago has been labeled as the most exotic island chain in the world. Pristine sands and azure blue sea make it a much loved holiday destination, but bizarre creatures; many of enormous size also roam the islands. The world's largest crab scales trees in search of coconuts, and clouds of giant bats fill the skies at dusk.

2)  Caribbean: The Wild Side of Paradise 
Between the continents of North and South America is a tropical paradise: The Caribbean. This is an archipelago of over 7,000 islands and reefs, lying within the crystal clear waters of the Caribbean Sea. From just a few metres wide, to hundreds of kilometers across, every island is different, and each has its own unique wildlife. Under the cover of darkness, giant leatherback turtles visit Trinidad's beaches to lay their eggs. Dominica's volcanic heritage gives it fertile soils, making the island rich in flowering plants. These provide food for some of the Caribbean's fastest movers: hummingbirds. The Caribbean's coral reefs are one of its richest treasures. Many of the species that find shelter here are found nowhere else. These warm, calm waters provide sanctuary for ocean giants too. Humpback whales travel thousands of miles to raise their young in the Caribbean Sea.

3)  Galapagos: Darwin's Eden 
Situated 1000 kilometres west of Ecuador in South America, the Galapagos archipelago contains 13 main islands and a hundred or so smaller rocks and reefs. The region's wilderness is so pristine and rich in life it altered our entire view of the natural world. Gigantic tortoises, sea-swimming lizards and cormorants that have evolved to no longer fly, are just some of the bizarre and unique creatures found here. Human influence has been so limited across the islands it allowed one man, Charles Darwin, to study and rethink the laws of Nature.

4)  Sri Lanka: Monsoon Island 
This film uncovers how all life on Sri Lanka centres on one precious resource: water. Unusually, two different monsoons visit the island each year, drenching the windswept coastal plains with weeks of torrential rain. For the rest of the year, the animals of the plains must endure months of drought. Elephants numbering in their hundreds gather on the shores of a vast lake in search of water. Bold Sri Lankan leopards stalk spotted deer visiting waterholes. Mugger crocodiles, confined within small pools, choose the dry season to mate. Bee-eaters dig nesting tunnels in the dusty ground, and troops of toque macaques battle for status and hierarchy in the island's ancient Buddhist monuments.

5)  Hebrides: Land of Legends 
Lying just off the coast of West Scotland, the Hebrides archipelago is made up of more than 500 islands and islets. Over 35,000 Grey seals choose one small beach to give birth and do battle for breeding rights. On other isles, some of the world's largest gatherings of sea birds engulf precipitous cliffs in a bid to raise their young. On the Isle of Rum, Britain's largest land mammal, the red deer, prepares for the annual rut, while Golden eagles patrol the skies anticipating their next meal. For thousands of years, people have battled with the Hebridean elements - the most treacherous on the planet and the roar from the world's third largest whirlpool can be heard up to 16 kilometres away

